import React from 'react'
import "../pages/Signup.css";
import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
import { Button } from '@mui/material';
import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles({
    bg: {
        backgroundImage: 'url("https://wallpaperaccess.com/full/1099445.png")',
        height: "151%",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover"
    },
    form: {
        paddingTop: "200px",
        paddingLeft: "50px",
        paddingRight: "50px"
    }
})

export default function Signup() {
    const classes = useStyles();
    return (
        <>
            <Grid container>
                <Grid item lg={8}>
                    <div className={classes.bg}></div>
                </Grid>
                <Grid item lg={4}>
                    <form className={classes.form}>
                        <TextField className="mb-4" label="Email" type="email" variant="standard" fullWidth={true} />
                        <TextField className="my-4" label="Password" type="password" variant="standard" fullWidth={true} />
                        <Button className="mt-4" type="submit" variant="contained">submit</Button>
                    </form>
                </Grid>
            </Grid>
        </>
    )
}
